import { GoogleGenAI } from "@google/genai";
import { PRODUCTS } from '../constants';

const getSystemInstruction = () => {
  const productContext = PRODUCTS.map(p => 
    `- ${p.name} (R$${p.price}): ${p.description}. Características: ${p.features.join(', ')}`
  ).join('\n');

  return `Você é o Concierge de IA da "Aura Metals", uma marca premium de metais industriais e arquitetônicos. 
  Seu tom é técnico, profissional, porém convidativo e sofisticado. Você é um especialista em ligas metálicas, acabamentos e aplicações arquitetônicas.

  Aqui está o nosso catálogo atual de placas metálicas:
  ${productContext}

  Responda perguntas dos clientes sobre especificações técnicas, recomendações de materiais para ambientes específicos (ex: litoral requer Inox 316) e filosofia da marca.
  Mantenha as respostas concisas (geralmente abaixo de 3 frases) para caber na interface do chat. 
  Sempre responda em Português do Brasil.
  Se perguntarem sobre eletrônicos ou outros produtos, explique gentilmente que a Aura Metals foca exclusivamente na excelência da metalurgia de precisão.`;
};

export const sendMessageToGemini = async (history: {role: string, text: string}[], newMessage: string): Promise<string> => {
  try {
    let apiKey: string | undefined;

    try {
      apiKey = process.env.API_KEY;
    } catch (e) {
      console.warn("Accessing process.env failed");
    }

    if (!apiKey) {
      return "Desculpe, não consigo me conectar ao servidor agora. (API Key ausente)";
    }

    const ai = new GoogleGenAI({ apiKey });

    const chat = ai.chats.create({
      model: 'gemini-3-flash-preview',
      config: {
        systemInstruction: getSystemInstruction(),
      },
      history: history.map(h => ({
        role: h.role,
        parts: [{ text: h.text }]
      }))
    });

    const result = await chat.sendMessage({ message: newMessage });
    return result.text;

  } catch (error) {
    console.error("Gemini API Error:", error);
    return "Peço desculpas, mas parece que estou tendo dificuldades para acessar nossos arquivos técnicos no momento.";
  }
};

