import React, { useState, useRef, useEffect } from 'react';
import { ChatMessage } from '../types';
import { sendMessageToGemini } from '../services/geminiService';

const Assistant: React.FC = () => {
  const [isOpen, setIsOpen] = useState(false);
  const [messages, setMessages] = useState<ChatMessage[]>([
    { role: 'model', text: 'Olá! Sou o estrategista de Growth da MKT-Solutions. Como posso ajudar você a atingir seus Web Digital Plans hoje?', timestamp: Date.now() }
  ]);
  const [inputValue, setInputValue] = useState('');
  const [isThinking, setIsThinking] = useState(false);
  const scrollRef = useRef<HTMLDivElement>(null);

  useEffect(() => {
    if (scrollRef.current) scrollRef.current.scrollTop = scrollRef.current.scrollHeight;
  }, [messages, isOpen]);

  const handleSend = async () => {
    if (!inputValue.trim()) return;
    const userMsg: ChatMessage = { role: 'user', text: inputValue, timestamp: Date.now() };
    setMessages(prev => [...prev, userMsg]);
    setInputValue('');
    setIsThinking(true);
    try {
      const responseText = await sendMessageToGemini(messages.map(m => ({ role: m.role, text: m.text })), userMsg.text);
      setMessages(prev => [...prev, { role: 'model', text: responseText, timestamp: Date.now() }]);
    } finally {
      setIsThinking(false);
    }
  };

  return (
    <div className="fixed bottom-8 right-8 z-50 flex flex-col items-end">
      {isOpen && (
        <div className="bg-white rounded-[2rem] shadow-[0_30px_60px_-15px_rgba(255,102,0,0.2)] w-[90vw] sm:w-[420px] h-[650px] mb-6 flex flex-col overflow-hidden border border-slate-100 animate-fade-in-up">
          <div className="bg-[#1a1a1a] p-8 flex justify-between items-center text-white">
            <div className="flex items-center gap-4">
              <div className="w-4 h-4 bg-[#FF6600] rounded-full animate-pulse shadow-[0_0_15px_#FF6600]"></div>
              <div className="flex flex-col">
                  <span className="font-black text-xl tracking-tighter">mkt.solutions</span>
                  <span className="text-[8px] uppercase tracking-widest opacity-50 font-bold">Growth Intelligence</span>
              </div>
            </div>
            <button onClick={() => setIsOpen(false)} className="bg-white/10 hover:bg-white/20 p-2 rounded-full transition-colors"><svg className="w-6 h-6" fill="none" stroke="currentColor" viewBox="0 0 24 24"><path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M6 18L18 6M6 6l12 12" /></svg></button>
          </div>
          <div className="flex-1 overflow-y-auto p-8 space-y-8 bg-slate-50/50" ref={scrollRef}>
            {messages.map((msg, idx) => (
              <div key={idx} className={`flex ${msg.role === 'user' ? 'justify-end' : 'justify-start'}`}>
                <div className={`max-w-[85%] p-5 rounded-3xl text-sm font-bold leading-relaxed ${msg.role === 'user' ? 'bg-[#FF6600] text-white shadow-xl shadow-orange-100 rounded-tr-none' : 'bg-white border border-slate-200 text-slate-700 shadow-sm rounded-tl-none'}`}>
                  {msg.text}
                </div>
              </div>
            ))}
            {isThinking && <div className="flex gap-2 p-5 bg-white border border-slate-200 rounded-3xl w-fit"><div className="w-2 h-2 bg-[#FF6600] rounded-full animate-bounce"></div><div className="w-2 h-2 bg-[#FF6600] rounded-full animate-bounce delay-100"></div><div className="w-2 h-2 bg-[#FF6600] rounded-full animate-bounce delay-200"></div></div>}
          </div>
          <div className="p-6 bg-white border-t border-slate-100">
            <div className="flex gap-3">
              <input value={inputValue} onChange={e => setInputValue(e.target.value)} onKeyDown={e => e.key === 'Enter' && handleSend()} placeholder="Como escalar sua conversão?" className="flex-1 bg-slate-50 border border-slate-200 px-6 py-4 rounded-2xl text-sm outline-none focus:ring-4 focus:ring-orange-50 font-bold" />
              <button onClick={handleSend} className="bg-[#FF6600] text-white p-4 rounded-2xl hover:bg-[#e65c00] shadow-lg shadow-orange-200 transition-all"><svg className="w-6 h-6" fill="none" stroke="currentColor" viewBox="0 0 24 24"><path strokeLinecap="round" strokeLinejoin="round" strokeWidth={3} d="M13.5 4.5L21 12m0 0l-7.5 7.5M21 12H3" /></svg></button>
            </div>
          </div>
        </div>
      )}
      <button onClick={() => setIsOpen(!isOpen)} className="bg-[#FF6600] text-white w-20 h-20 flex items-center justify-center rounded-full shadow-2xl hover:scale-110 transition-all border-8 border-white group relative">
        {isOpen ? <svg className="w-8 h-8" fill="none" stroke="currentColor" viewBox="0 0 24 24"><path strokeLinecap="round" strokeLinejoin="round" strokeWidth={3} d="M19 9l-7 7-7-7" /></svg> : <span className="font-black text-3xl italic">m</span>}
        {!isOpen && <div className="absolute -top-1 -right-1 w-4 h-4 bg-white rounded-full flex items-center justify-center"><div className="w-2 h-2 bg-[#FF6600] rounded-full"></div></div>}
      </button>
    </div>
  );
};

