import { GoogleGenAI, Type, FunctionDeclaration } from "@google/genai";
import { PRODUCTS } from '../constants.ts';

const enviarTranscricaoDeclaration: FunctionDeclaration = {
  name: 'enviarTranscricao',
  parameters: {
    type: Type.OBJECT,
    description: 'Envia os dados de contato do cliente e a transcrição da conversa para o setor de atendimento.',
    properties: {
      nome: { type: Type.STRING, description: 'Nome completo do cliente' },
      email: { type: Type.STRING, description: 'E-mail do cliente' },
      whatsapp: { type: Type.STRING, description: 'WhatsApp/Telefone do cliente' },
      resumo: { type: Type.STRING, description: 'Breve resumo da necessidade do cliente' }
    },
    required: ['nome', 'email', 'whatsapp', 'resumo'],
  },
};

const getSystemInstruction = () => {
  const serviceContext = PRODUCTS.map(p => 
    `- ${p.name}: ${p.description}`
  ).join('\n');

  return `Você é um estrategista sênior da MKT-Solutions (35 anos). Você é educado, direto e evita formalidades robóticas.

OBJETIVO PRINCIPAL: 
1. Ajudar o cliente com dúvidas sobre marketing.
2. **OBRIGATÓRIO**: Em algum momento natural da conversa (antes de encerrar ou ao sugerir um plano), você DEVE capturar o Nome, E-mail e WhatsApp do cliente.
3. Assim que tiver esses 3 dados e a conversa estiver caminhando para o fim (ou o cliente solicitar um contato), chame a função 'enviarTranscricao'.

Diretrizes de conversação:
- Respostas Curtas: Máximo 2 ou 3 frases.
- Em Etapas: Não peça tudo de uma vez. Pergunte o nome, depois o desafio, depois o contato.
- Tom Humano: Fale como um consultor real.
- Quando chamar 'enviarTranscricao', informe ao cliente que um especialista entrará em contato em breve e que a transcrição foi enviada para o e-mail atendimento@mkt-solutions.com.br.

Contexto de Serviços:
${serviceContext}`;
};

export const sendMessageToGemini = async (
  history: {role: string, text: string}[], 
  newMessage: string
): Promise<{ text: string, functionCall?: any }> => {
  try {
    const apiKey = process.env.API_KEY;
    if (!apiKey) return { text: "Estou com uma instabilidade técnica. Pode tentar de novo?" };

    const ai = new GoogleGenAI({ apiKey });
    const response = await ai.models.generateContent({
      model: 'gemini-3-flash-preview',
      contents: [
        ...history.map(h => ({ role: h.role === 'model' ? 'model' : 'user', parts: [{ text: h.text }] })),
        { role: 'user', parts: [{ text: newMessage }] }
      ],
      config: {
        systemInstruction: getSystemInstruction(),
        tools: [{ functionDeclarations: [enviarTranscricaoDeclaration] }],
      },
    });

    const candidate = response.candidates?.[0];
    const parts = candidate?.content?.parts || [];

    let text = "";
    let functionCall = null;

    for (const part of parts) {
      if (part.text) text += part.text;
      if (part.functionCall) functionCall = part.functionCall;
    }

    return { text, functionCall };

  } catch (error) {
    console.error("Gemini API Error:", error);
    return { text: "Tive um pequeno erro aqui. Pode repetir?" };
  }
};

