import React, { useState, useRef, useEffect } from 'react';
import { ChatMessage } from '../types.ts';
import { sendMessageToGemini } from '../services/geminiService.ts';

const Assistant: React.FC = () => {
  const [isOpen, setIsOpen] = useState(false);
  const [messages, setMessages] = useState<ChatMessage[]>([
    { role: 'model', text: 'Oi! Tudo bem? Sou consultor aqui na MKT e adoro conversar sobre estratégias de crescimento. Como está o momento da sua empresa hoje?', timestamp: Date.now() }
  ]);
  const [inputValue, setInputValue] = useState('');
  const [isThinking, setIsThinking] = useState(false);
  const [isSendingEmail, setIsSendingEmail] = useState(false);
  const [isFinished, setIsFinished] = useState(false);
  const scrollRef = useRef<HTMLDivElement>(null);

  useEffect(() => {
    if (scrollRef.current) scrollRef.current.scrollTop = scrollRef.current.scrollHeight;
  }, [messages, isOpen, isThinking, isSendingEmail]);

  const handleSend = async () => {
    if (!inputValue.trim() || isFinished || isSendingEmail) return;

    const userMsg: ChatMessage = { role: 'user', text: inputValue, timestamp: Date.now() };
    setMessages(prev => [...prev, userMsg]);
    setInputValue('');
    setIsThinking(true);

    try {
      const history = messages.map(m => ({ role: m.role, text: m.text }));
      const result = await sendMessageToGemini(history, userMsg.text);

      if (result.functionCall && result.functionCall.name === 'enviarTranscricao') {
        const args = result.functionCall.args;
        setIsSendingEmail(true);

        const WEBHOOK_URL = 'https://formsubmit.co/ajax/atendimento@mkt-solutions.com.br'; 

        const payload = {
          _subject: `Novo Lead IA: ${args.nome}`,
          nome: args.nome,
          email: args.email,
          whatsapp: args.whatsapp,
          resumo: args.resumo,
          transcricao: [...history, { role: 'user', text: userMsg.text }].map(m => 
            `${m.role === 'user' ? 'Cliente' : 'Estrategista'}: ${m.text}`
          ).join('\n')
        };

        try {
          await fetch(WEBHOOK_URL, { 
            method: 'POST', 
            headers: { 'Content-Type': 'application/json', 'Accept': 'application/json' },
            body: JSON.stringify(payload) 
          });

          const confirmationMsg = `Perfeito, ${args.nome.split(' ')[0]}. Já anotei tudo e enviei pessoalmente para o meu time comercial. Eles vão dar uma olhada no seu caso com carinho e te chamam no WhatsApp, tá bom?`;

          setMessages(prev => [...prev, { role: 'model', text: confirmationMsg, timestamp: Date.now() }]);
          setIsFinished(true);
        } catch (error) {
          console.error("Erro ao enviar e-mail:", error);
          setMessages(prev => [...prev, { role: 'model', text: "Anotei seus dados, mas tive um probleminha no meu sistema de envio agora. Fica tranquilo que eu já deixei o alerta aqui para o time!", timestamp: Date.now() }]);
          setIsFinished(true);
        } finally {
          setIsSendingEmail(false);
        }
      } else if (result.text) {
        setMessages(prev => [...prev, { role: 'model', text: result.text, timestamp: Date.now() }]);
      }
    } catch (err) {
      setMessages(prev => [...prev, { role: 'model', text: "Minha conexão falhou por um segundo. Pode me contar de novo?", timestamp: Date.now() }]);
    } finally {
      setIsThinking(false);
    }
  };

  return (
